  PropsWithChildren<ButtonProps & React.ButtonHTMLAttributes<HTMLButtonElement>>
> = (props) => {
  const { children } = props;
  return <ButtonStyled {...props}>{children}</ButtonStyled>;
};

const ButtonStyled = styled.button`
  color: black
